@luckythirteen2631 You only need 12GB to run 1440p at Medium settings on most games from the last 7 years.
16GB is a nice overhead, means you dont run out in graphics effects heavy games, but 12GB with careful setting use is perfectly fine.
Most of my performance increase from my RTX 2070 Super 8GB to my Radeon 7800 XT 16GB was the VRAM, most video games choke on the massive G-Buffers at 1440p which take up 1-2GB of memory alone, leaving just a paltry 5-6GB of memory for textures, effects, model data, etc.
